import React from "react";

const TheItem = (props) => {
  return (
    <div className="item">
      <div className="item__image">
        <img
          src={`https://image.tmdb.org/t/p/w500${props.pic}`}
          alt="item"
        ></img>
      </div>
      <div className="item__desc">
        {props.title}
        <h5>24</h5>
      </div>
    </div>
  );
};

export default TheItem;
